@N-HHIts all about what a man can or can not do, N-HH. You can accept that this article is about a historical military-administered territory officially named ""Territory of the Military Commander in Serbia"", or you can not. Me, I can ignore your PA comments, but I can't agree that the title should be changed to any phrase that doesn't refer in some way to this said territory, which is the subject of the article. Savvy?
As for your grammar concerns, you should probably make it clear which classes of words you consider too irrelevant to enter our considerations. Though I certainly hope you are clear on the difference between the words ""of"" and ""in"", and how they may alter the sentence. As in ""I was sick of this one year ago"", and ""I was sick in this one year ago"". 

@FkpCascais. Oh please, Fkp. Its me. The ""I'm insulted he hinted I'm a nationalist"" thing is so old it ""has a beard"" as we say 'round these parts. I know you so long I can produce a half-dozen diffs at any time to show an editing pattern as the one I hinted at. And no, this isn't a ""fake Serbia"" like the NDH was a fake Croatia, it was a military occupation zone ""in Serbia"", the ""Serbia"" referred to there is just a geographic qualification indicating where this entity is located in. You need to clear from your head all that ""Nedićeva Srbija"" nonsense that they teach us in grade school. The Serbian article actually has a flag and coat of arms under an infobox title that says ""Serbia"", and you just called this a ""country"". I'll say it again: this is an occupation zone created by Hitler, where his army picked some willing stooges to run the police and collect taxes/steal food. Hitler hated Serbs with a passion and didn't give them anything even closely resembling a country. It takes a special kind of crazy to go around fighting for recognition screaming ""hey, don't you go denigrating Serbia! we were just as much Nazi puppets as you were!"". Yet that is exactly what I've been reading here for years on end. So forgive me if I'm a little sick of it.

@Peacemaker, I challenge your assertion that there is no WP:COMMONNAME for this territory, and claim 'Military Administration in Serbia' is a name used on a wide-enough basis to qualify as such.   (talk) "

Additions to the Västerbottens Fotbollförbund page

I have created a page for Västerbottens Fotbollförbund as a stub that can now be developed by those with a far greater knowledge of Västerbottens Fotbollförbund football than myself.  It would be great to see articles and photos added to the page covering for example key officials, organisation headquarters, gala presentations, historic facts, district cup winners and much more.

  (Finnish Gas )

 Notability Criteria - Clubs affiliated to Västerbottens Fotbollförbund 

Clubs playing in Division 4 and below may not meet Wikipedia's notability criteria.  If you wish to produce a Wikipedia page for your club I suggest that you ensure that you take appropriate measures to emphasise that your club is notable.  This may be achieved by including details of at least one of the following:

1. - club achievements in particular competing in the higher levels of the Swedish football league system (Division 3 and above 1987 onwards / Division 4 and above pre 1987); 
2. - a notable player(s) who has played for the club;
3. - widening the description of the club to include details of other sections of the club (some of whom may have made a notable contribution to their sport);
4. - significant club infrastructure that has been provided or is managed by the club such as an indoor sports hall and all weather pitches;
5. - special contribution to the local community such as clubs serving the needs of ethnic communities;
6. - unique features such as an island location or historic stadium.

Failure to meet notability criteria could result in your page being recommended for deletion.

  (Finnish Gas )
